import { AfterViewInit, Component, ElementRef, ViewChild, HostListener } from '@angular/core';
import * as THREE from 'three';
import "./js/EnableThreeExamples";
import "three/examples/js/controls/OrbitControls";

@Component({
  selector: 'cypher-screen',
  templateUrl: 'cypher.html'
})
export class CypherComponent implements AfterViewInit {

  private renderer: THREE.WebGLRenderer;
  private camera: THREE.PerspectiveCamera;
  public scene: THREE.Scene;

  public fieldOfView: number = 45;
  public nearClippingPane: number = 0.1;
  public farClippingPane: number = 20000;

  public controls: THREE.OrbitControls;

  public stabilis: THREE.Object3D;
  public mobilis: THREE.Object3D;
  private stabilisRotate = false;
  private mobilisRotate = false;
  private stabilisFi;
  private mobilisFi;
  private mouseFi;

  @ViewChild('canvas')
  private canvasRef: ElementRef;

  constructor() {
    this.render = this.render.bind(this);
    this.onMouseMove = this.onMouseMove.bind(this);
    this.onTouchMove = this.onTouchMove.bind(this);
  }

  private get canvas(): HTMLCanvasElement {
    return this.canvasRef.nativeElement;
  }

  private createScene() {
    this.scene = new THREE.Scene();
    this.makeCipher();
  }

  private createLight() {

    let light1 = new THREE.PointLight(0xffffff);
    light1.position.set(60, 100, 250);
    this.scene.add(light1);

    let light2 = new THREE.PointLight(0xffffff);
    light2.position.set(60, 100, -250);
    this.scene.add(light2);

    let light3 = new THREE.PointLight(0xffffff);
    light3.position.set(140, 400, 5);
    this.scene.add(light3);

  }

  private createCamera() {
    let aspectRatio = this.getAspectRatio();
    this.camera = new THREE.PerspectiveCamera(
      this.fieldOfView,
      aspectRatio,
      this.nearClippingPane,
      this.farClippingPane
    );
    let dist = Math.abs(60 / Math.sin(Math.PI / 8));
    dist = aspectRatio < 1 ? dist / aspectRatio : dist;

    // Set position and look at
    this.camera.position.x = 0;
    this.camera.position.y = 0;
    this.camera.position.z = dist;

    this.camera.lookAt(this.scene.position);
  }

  private getAspectRatio(): number {
    let height = this.canvas.clientHeight;
    if (height === 0) {
      return 0;
    }
    return this.canvas.clientWidth / this.canvas.clientHeight;
  }

  private startRendering() {
    this.renderer = new THREE.WebGLRenderer({
      canvas: this.canvas,
      antialias: true
    });
    this.renderer.setPixelRatio(devicePixelRatio);
    this.renderer.setSize(this.canvas.clientWidth, this.canvas.clientHeight);

    this.renderer.shadowMap.enabled = true;
    this.renderer.shadowMap.type = THREE.PCFSoftShadowMap;
    this.renderer.autoClear = true;

    let component: CypherComponent = this;

    (function render() {
      requestAnimationFrame(render);
      component.render();
    }());
  }

  public render() {
    //requestAnimationFrame(this.render);
    //this.controls.update();
    this.renderer.render(this.scene, this.camera);
  }

  public addControls() {
    this.controls = new THREE.OrbitControls(this.camera);
    this.controls.rotateSpeed = 1.0;
    this.controls.zoomSpeed = 1.2;
    this.controls.addEventListener('change', this.render);
  }

  /* EVENTS */

  public onMouseDown(event: MouseEvent) {
    event.preventDefault();

    var mouse = new THREE.Vector3();
    mouse.set(
      (event.clientX / this.renderer.domElement.clientWidth) * 2 - 1,
      -(event.clientY / this.renderer.domElement.clientHeight) * 2 + 1,
      0.5
    );
    mouse.unproject(this.camera).sub(this.camera.position).normalize();

    var raycaster = new THREE.Raycaster(this.camera.position, mouse);

    var intersects_m = raycaster.intersectObject(this.mobilis, true);
    if (intersects_m.length > 0) {
      this.canvas.style.cursor = 'pointer';
      this.controls.enableRotate = false;
      this.mouseFi = this.getMouseAngle(event);
      this.mobilisFi = this.mobilis.rotation.z;
      this.mobilisRotate = true;
      this.renderer.domElement.addEventListener('mousemove', this.onMouseMove, false);
      return;
    }

    var intersects_s = raycaster.intersectObject(this.stabilis, true);
    if (intersects_s.length > 0) {
      this.canvas.style.cursor = 'pointer';
      this.controls.enableRotate = false;
      this.mouseFi = this.getMouseAngle(event);
      this.mobilisFi = this.mobilis.rotation.z;
      this.stabilisFi = this.stabilis.rotation.z;
      this.stabilisRotate = true;
      this.renderer.domElement.addEventListener('mousemove', this.onMouseMove, false);
      return;
    }

  }

  public onMouseMove(event: MouseEvent) {
    if (this.stabilisRotate || this.mobilisRotate) {
      event.preventDefault();
      var angle = this.getMouseAngle(event) - this.mouseFi;
      this.mobilis.rotation.z = angle + this.mobilisFi;
      if (this.stabilisRotate) {
        this.stabilis.rotation.z = angle + this.stabilisFi;
      }
    }
  }

  public onMouseUp(event: MouseEvent) {
    event.preventDefault();
    this.renderer.domElement.removeEventListener('mousemove', this.onMouseMove, false);
    this.mobilisRotate = false;
    this.stabilisRotate = false;
    this.mouseFi = 0;
    this.controls.enableRotate = true;
    //this.cypher();
    this.canvas.style.cursor = 'default';
  }

  public onTouchStart(event) {
    if (event.touches.length === 1) {
      this.renderer.domElement.addEventListener('touchmove', this.onTouchMove, false);
      event.clientX = event.touches[0].clientX;
      event.clientY = event.touches[0].clientY;
      event.buttons = 1;
      this.onMouseDown(event);
    }
  }

  public onTouchEnd(event) {
    this.renderer.domElement.removeEventListener('touchmove', this.onTouchMove, false);
    this.onMouseUp(event);
  }

  public onTouchMove(event) {
    if (event.touches.length === 1) {
      event.clientX = event.touches[0].clientX;
      event.clientY = event.touches[0].clientY;
      event.buttons = 1;
      this.onMouseMove(event);
    }
  }

  private getMouseAngle(event: MouseEvent) {
    var mouse = new THREE.Vector3();
    mouse.set(
      (event.clientX / this.renderer.domElement.clientWidth) * 2 - 1,
      -(event.clientY / this.renderer.domElement.clientHeight) * 2 + 1,
      0.5
    );
    mouse.unproject(this.camera).sub(this.camera.position).normalize();

    var distance = -this.camera.position.z / mouse.z;
    var pos = this.camera.position.clone().add(mouse.multiplyScalar(distance));
    //The variable pos is the position of the point in 3D space, "under the mouse", and in the plane z=0.

    var up = new THREE.Vector3(0, 1, 0);
    return -Math.sign(pos.x) * Math.acos(up.dot(pos.normalize()));
  }

  @HostListener('window:resize', ['$event'])
  public onResize(event: Event) {
    this.canvas.style.width = "100%";
    this.canvas.style.height = "100%";
    this.camera.aspect = this.getAspectRatio();
    this.camera.updateProjectionMatrix();
    this.renderer.setSize(this.canvas.clientWidth, this.canvas.clientHeight);
    this.render();
  }

  @HostListener('document:keypress', ['$event'])
  public onKeyPress(event: KeyboardEvent) {
    console.log("onKeyPress: " + event.key);
  }

  /* LIFECYCLE */
  ngAfterViewInit() {
    this.createScene();
    this.createLight();
    this.createCamera();
    this.addControls();
    this.startRendering();
  }

  makeCipher() {
    var loader = new THREE.TextureLoader();

    //var mobilisTexture = loader.load('res/mobilis.png');
    var mobilisTexture = loader.load('data:image/png;base64,');

    //var stabilisTexture = loader.load('res/stabilis.png');
    var stabilisTexture = loader.load('data:image/png;base64,');

    //var backTexture = loader.load('res/back.png');
    var backTexture = loader.load('data:image/png;base64,');

    var stabiFaceMaterial = new THREE.MeshPhongMaterial({
      map: stabilisTexture,
      bumpMap: stabilisTexture,
      color: 0x555555,
      specular: 0x2222ff,
      shininess: 50
    });
    var mobiFaceMaterial = new THREE.MeshPhongMaterial({
      map: mobilisTexture,
      bumpMap: mobilisTexture,
      color: 0x444444,
      specular: 0x2222ff,
      shininess: 50
    });
    var stabiBackMaterial = new THREE.MeshPhongMaterial({
      map: backTexture,
      bumpMap: backTexture,
      color: 0x111111,
      specular: 0x2222ff,
      shininess: 40,
      side: THREE.BackSide
    });
    var cylinderMaterial = new THREE.MeshPhongMaterial({
      color: 0x444444,
      specular: 0x1122ff,
      shininess: 40
    });

    var circleGeometry = new THREE.CircleGeometry(60, 72);
    var cylinderGeometry = new THREE.CylinderGeometry(60, 60, 2, 72, 1, true);

    var stabiFace = new THREE.Mesh(circleGeometry, stabiFaceMaterial);
    stabiFace.position.set(0, 0, 0);

    var stabiCylinder = new THREE.Mesh(cylinderGeometry, cylinderMaterial);
    stabiCylinder.position.set(0, 0, -1);
    stabiCylinder.rotation.x = Math.PI / 2;

    var stabiBack = new THREE.Mesh(circleGeometry, stabiBackMaterial);
    stabiBack.position.set(0, 0, -2);

    var r = 0.72;
    var mobiFace = new THREE.Mesh(circleGeometry, mobiFaceMaterial);
    mobiFace.scale.set(r, r, 1);
    mobiFace.position.set(0, 0, 0);

    var mobiCylinder = new THREE.Mesh(cylinderGeometry, cylinderMaterial);
    mobiCylinder.scale.set(r, 0.1, r);
    mobiCylinder.position.set(0, 0, -1);
    mobiCylinder.rotation.x = Math.PI / 2;

    this.stabilis = new THREE.Object3D();
    this.stabilis.name = 'stabilis';
    this.stabilis.add(stabiFace);
    this.stabilis.add(stabiCylinder);
    this.stabilis.add(stabiBack);
    this.stabilis.position.set(0, 0, 0);
    this.scene.add(this.stabilis);

    this.mobilis = new THREE.Object3D();
    this.mobilis.name = 'mobilis';
    this.mobilis.add(mobiFace);
    this.mobilis.add(mobiCylinder);
    this.mobilis.position.set(0, 0, 0.2);
    this.scene.add(this.mobilis);
  }

}
